import React from "react";
import CIcon from "@coreui/icons-react";

const _nav = [
  {
    _tag: "CSidebarNavItem",
    name: "Dashboard",
    to: "/dashboard",
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon" />,
    badge: {
      color: "info",
      text: "NEW",
    },
  },

 
  // Brand
  {
    _tag: "CSidebarNavItem",
    name: "Socials",
    to: "/social",
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon" />,
  },

  // Category
  {
    _tag: "CSidebarNavItem",
    name: "Cause",
    to: "/category",
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon" />,
  },

 
  // supplier
  {
    _tag: "CSidebarNavItem",
    name: "Supplier",
    to: "/manage_supplier",
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon" />,
  },
  // Import
  {
    _tag: "CSidebarNavItem",
    name: "Import",
    to: "/import",
    icon: <CIcon name="cil-speedometer" customClasses="c-sidebar-nav-icon" />,
  },
 
];

export default _nav;
